INSERT INTO `wp_posts` VALUES (58,1,'2024-05-08 19:00:17','2024-05-08 19:00:17','<!-- wp:paragraph -->\n<p>Ever thought about exploring Australia’s Northern Territory? If not, you definitely should! This place is a goldmine of stunning landscapes, rich cultural heritage, and diverse wildlife. Earlier this year, I had the opportunity to explore Darwin and its surroundings on my way from New Zealand to Timor-Leste with my girlfriend.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our experience in Australia’s Northern Territory was awesome and it was definitely worth stopping here. From immersing ourselves in the Aboriginal community’s culture to exploring the vibrant local art scene, from tasting green ants to spotting crocodiles in the wild, every day was filled with new experiences and discoveries.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So, are you ready to embark on an unforgettable journey to Australia’s Northern Territory? Let’s dive in!</p>\n<!-- /wp:paragraph -->','Itinerary: 3 days in Darwin, in Australia’s Northern Territory','','publish','open','open','','itinerary-3-days-in-darwin-in-australias-northern-territory','','','2024-05-08 19:00:17','2024-05-08 19:00:17','',0,'http://ameliagoodson.local/?p=58',0,'post','',0);
