INSERT INTO `wp_posts` VALUES (61,1,'2024-05-08 19:01:33','2024-05-08 19:01:33','<!-- wp:paragraph -->\n<p>This week, Australia reopened its borders to international travelers after the popular country was completely closed for over 700 days. After since I’ve spent over 4 months in the beautiful city of Sydney in the past, I figured I was in a good position to write up a little bucket list to inspire you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I’m happy to share this list with you today, which might be useful for your next visit to the Australian metropolis if you eventually take advantage of a good price to Sydney on Flytrippers’&nbsp;<a href=\"https://flytrippers.com/#dealSection\">cheap flight deals</a>&nbsp;page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The best part is that even though the cost of living in Sydney is expensive, most of the things on this list are either free or affordable.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So here are&nbsp;<strong>12 must-dos in and around Sydney</strong>.</p>\n<!-- /wp:paragraph -->','Australia is open: 12 things to do in and around Sydney','','publish','open','open','','australia-is-open-12-things-to-do-in-and-around-sydney','','','2024-05-08 19:01:34','2024-05-08 19:01:34','',0,'http://ameliagoodson.local/?p=61',0,'post','',0);
