INSERT INTO `wp_posts` VALUES (82,1,'2024-05-08 20:06:37','2024-05-08 20:06:37','<!-- wp:paragraph -->\n<p>The Government of Canada continues to continue to take action, and in the wake of recent incidents, it has decided to ban all flights on Boeing airplanes… unless you have special insurance. Flytrippers happens to have some truly good travel insurance tips.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here are the details of this new law.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Travel insurance</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The announcement was made this morning on the 1st of the month, and only one airline is excluded from the rule.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The airline excluded from the new rule is April Fool’s Air — but travel insurance&nbsp;<strong>is a very serious subject</strong>, and I strongly encourage you to take 5 minutes of this April Fool’s Day to learn such simple and important pro tips.</p>\n<!-- /wp:paragraph -->','New law: Canada bans all flights on Boeing planes if you don’t get their special insurance','','publish','open','open','','new-law-canada-bans-all-flights-on-boeing-planes-if-you-dont-get-their-special-insurance','','','2024-05-08 20:08:03','2024-05-08 20:08:03','',0,'http://ameliagoodson.local/?p=82',0,'post','',0);
