INSERT INTO `wp_posts` VALUES (84,1,'2024-05-08 20:06:37','2024-05-08 20:06:37','<!-- wp:paragraph -->\n<p>The Government of Canada continues to continue to take action, and in the wake of recent incidents, it has decided to ban all flights on Boeing airplanes… unless you have special insurance. Flytrippers happens to have some truly good travel insurance tips.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here are the details of this new law.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Travel insurance</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The announcement was made this morning on the 1st of the month, and only one airline is excluded from the rule.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The airline excluded from the new rule is April Fool’s Air — but travel insurance&nbsp;<strong>is a very serious subject</strong>, and I strongly encourage you to take 5 minutes of this April Fool’s Day to learn such simple and important pro tips.</p>\n<!-- /wp:paragraph -->','New law: Canada bans all flights on Boeing planes if you don’t get their special insurance','','inherit','closed','closed','','82-revision-v1','','','2024-05-08 20:06:37','2024-05-08 20:06:37','',82,'http://ameliagoodson.local/?p=84',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (85,1,'2024-05-08 20:07:48','2024-05-08 20:07:48','<!-- wp:paragraph -->\n<p>Air Canada and WestJet, Canada’s 2 largest airlines, increased their fees for checked baggage in early March. Paying for luggage instead of saving your money to travel more (or to spoil yourself more or to invest elsewhere) is a real shame in our opinion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Flight pros never have checked baggage, which is obviously&nbsp;<strong>the simplest</strong>&nbsp;way to avoid these fees. Not only is it more&nbsp;<em>affordable</em>, it’s so much more&nbsp;<em>enjoyable</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>But there’s another very simple way&nbsp;</strong>to get free baggage on these airlines if you insist on bringing too much stuff.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here’s how.</p>\n<!-- /wp:paragraph -->','Baggage fee increase by Air Canada and WestJet: How to get free bags','','publish','open','open','','baggage-fee-increase-by-air-canada-and-westjet-how-to-get-free-bags','','','2024-05-29 19:28:34','2024-05-29 19:28:34','',0,'http://ameliagoodson.local/?p=85',0,'post','',0);
INSERT INTO `wp_posts` VALUES (86,1,'2024-05-08 20:07:40','2024-05-08 20:07:40','','baggage-fee-increase-air-canada-westjet','','inherit','open','closed','','baggage-fee-increase-air-canada-westjet','','','2024-05-08 20:07:40','2024-05-08 20:07:40','',85,'http://ameliagoodson.local/wp-content/uploads/2024/05/baggage-fee-increase-air-canada-westjet.jpg',0,'attachment','image/jpeg',0);
INSERT INTO `wp_posts` VALUES (87,1,'2024-05-08 20:07:48','2024-05-08 20:07:48','<!-- wp:paragraph -->\n<p>Air Canada and WestJet, Canada’s 2 largest airlines, increased their fees for checked baggage in early March. Paying for luggage instead of saving your money to travel more (or to spoil yourself more or to invest elsewhere) is a real shame in our opinion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Flight pros never have checked baggage, which is obviously&nbsp;<strong>the simplest</strong>&nbsp;way to avoid these fees. Not only is it more&nbsp;<em>affordable</em>, it’s so much more&nbsp;<em>enjoyable</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>But there’s another very simple way&nbsp;</strong>to get free baggage on these airlines if you insist on bringing too much stuff.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Here’s how.</p>\n<!-- /wp:paragraph -->','Baggage fee increase by Air Canada and WestJet: How to get free bags','','inherit','closed','closed','','85-revision-v1','','','2024-05-08 20:07:48','2024-05-08 20:07:48','',85,'http://ameliagoodson.local/?p=87',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (88,1,'2024-05-08 20:11:03','2024-05-08 20:11:03','<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://ameliagoodson.local/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2024-05-08 20:11:03','2024-05-08 20:11:03','',2,'http://ameliagoodson.local/?p=88',0,'revision','',0);
